import React, { Component } from 'react';

class Items extends Component {
    state = {
        items:[]
    }

    componentDidMount() {
        fetch(this.props['data-url'])
        .then(response => response.json())
        .then(items => this.setState({items}))
        .catch(error => {
            console.error(error);
        });
    }

    render() {

        return(
            <div className="container">
            <h1>Shop</h1>
            <table>
                <thead>
                    <tr>
                    <th>User name</th>
                    <th>Email</th>
                    <th>IP address</th>
                    </tr>
                </thead>
            </table>
            </div>
        );



    }


}

export default Items;
